contract Convert {
    function convert(uint256 choice, bytes32 randomBytes) public pure returns (bytes32) {
        require(choice <= 4, "Invalid choice"); // 0 - Rock, 1 - Paper, 2 - Scissors, 3 - Spock, 4 - Lizard
        return keccak256(abi.encodePacked(choice, randomBytes));
    }
}

